  position: absolute;
  right: 0;
  top: 5px;
  cursor: pointer;
  width: 34px;
  height: 22px;
  margin-left: auto;

  &:before {
    content: '';
    display: block;
    position: absolute;
    top: 10px;
    right: 10px;
    width: 15px;
    height: 1px;
    transform: rotate(-45deg);
    background: #000000;
  }

  &:after {
    content: '';
    display: block;
    position: absolute;
    top: 10px;
    right: 10px;
    width: 15px;
    height: 1px;
    transform: rotate(45deg);
